Правосла́вная це́рковь — вторая после Католической по числу последователей Христианская церковь в мире, насчитывающая около 225 миллионов христиан. Также может называться Православной церковью византийской традиции или греко-православной церковью. Для православных христиан Православная церковь — единая святая соборная и апостольская Церковь, составляющая Тело Христово, а Иисус Христос — её глава. Учение Православной церкви содержится в Священном предании, которое включает в себя кроме Священного Писания, определения Вселенских и некоторых поместных соборов, принятые всей Церковью, каноны (своды правил апостолов, Вселенских и некоторых поместных соборов), утвержденные Церковью литургические тексты, творения Отцов Церкви, жития святых, а также обычаи Церкви. При этом Предание, в понимании святоотеческой литературы, «есть жизнь Святого Духа в Церкви». Священное Писание для православных христиан является наиважнейшей формой Священного Предания. Православная церковь составляется сообществом поместных церквей — автокефальных и автономных. Каждая автокефальная церковь полностью самостоятельна и независима в делах своего канонического и административного управления. Автономные церкви находятся в канонической зависимости от той или иной автокефальной (кириархальной) церкви. Православные церкви в светской религиоведческой классификации делят на: 
*  мировое (вселенское) православие — четыре из пяти патриархатов древней пентархии: Константинопольский, Александрийский, Антиохийский, Иерусалимский (церкви собственно греко-византийской традиции наряду с Церковью Кипра, особый статус которых в неразделённой Христианской церкви закреплён постановлениями Вселенских Соборов) и находящиеся с ними в евхаристическом общении (то есть признанные как православные) поместные церкви; 
*  малочисленные юрисдикции греко-православной традиции, не признанные мировым православием и являющиеся с его точки зрения неканоническими (соответственно, не находящиеся в евхаристическом общении с ними, а зачастую и между собой).
